  `status` char(1) DEFAULT '0' COMMENT '帐号状态（0正常 1删除）',
  PRIMARY KEY (`group_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='标签组';

